import Button from '@atlaskit/button';
import styled, {css} from 'styled-components';

const ButtonStyled = styled(Button)`

`

function CourseItem() {
    return (
        <tr id="row-1">
            <th scope="row" className='align-middle'>1</th>
            <td className='align-middle'>Brandon Jacob</td>
            <td className='align-middle'>Tính từ</td>
            <td className='align-middle'>28</td>
            <td className='align-middle'>
                <div className="row">
                    <div className="icon col-md-6">
                        <ButtonConfig 
                            isComplete={true} 
                            iconAfter= { true && (
                                <span className='WatchIcon'>
                                    <WatchIcon />
                                </span>
                                )
                            }
                        > 
                        </ButtonConfig>
                    </div>
                    <div className="RemoveIcon icon col-md-6 ">
                        <ButtonConfig 
                            isComplete={true} 
                            iconAfter= { true && (
                                <span className='WatchIcon'>
                                    <TrashIcon />
                                </span>
                                )
                            }
                        > 
                        </ButtonConfig>
                    </div>
                </div>
            </td>
        </tr>
    );
}

export default CourseItem;
